import React, { Component } from "react";

export default class Comments extends Component {
  render() {
    const { comment } = this.props.itinerary;
    return (
      <div>
        <Card
          className="col-sm-4"
          border="warning"
          variant="primary"
          style={{ width: "12rem" }}
        >
          <Card.Title className="textColor">{comment.email}</Card.Title>
          <Card.Body>
            <Card.Text className="textColor">{comment.msg}</Card.Text>
            <Button variant="primary">Delete Comment</Button>
          </Card.Body>
        </Card>
      </div>
    );
  }
}
